function Info_proforma(props) {
    return (

        <div>
            <div className="mb-3 row">
                <label className="col-4 col-form-label">Date de livraison</label>
                <div className="col-6">
                    <input type="date" ref={props.date_livraison} className="form-control" name="date_livraison" />
                </div>
            </div>
            <div className="mb-3 row">
                <label className="col-4 col-form-label">Lieu de livraison</label>
                <div className="col-6">
                    <input type="text" ref={props.lieu_livraison} className="form-control" name="lieu_livraison" placeholder="Lieu" />
                </div>
            </div>
        </div>

    );
}
export default Info_proforma;
